import {Input, Button, Form, Select, DatePicker, InputNumber} from 'antd'

const SearchForm = ({onWhole, fetchList, gradeList}) => {
  const [form] = Form.useForm()

  const getFields = () => {
    const children = [
      <Form.Item label="街道/乡镇名称:" name="name">
        <Input style={{width: 180}} placeholder="请输入街道/乡镇名称" />
      </Form.Item>,

      <Form.Item label="信用评级" name="creditLevel" style={{marginLeft: 50}}>
        <Select style={{width: 130}}>
          <Select.Option value="">全部</Select.Option>
          {gradeList.map((v, i) => {
            return (
              <Select.Option value={v.level} key={i}>
                {v.desc}
              </Select.Option>
            )
          })}
        </Select>
      </Form.Item>,
    ]

    return children
  }

  return (
    <Form
      form={form}
      onFinish={(values) =>
        onWhole({
          ...values,
        })
      }
      layout="inline"
      className="searchForm"
      initialValues={{
        creditLevel: '',
      }}
    >
      {getFields()}
      <Button type="primary" style={{marginLeft: 80}} htmlType="submit">
        查询
      </Button>
    </Form>
  )
}

export default SearchForm
